unsigned int num_points_glo;
char **points_x_glo_hex; /* large pool of points */
char **points_y_glo_hex; /* large pool of points */

limb_t m_glo[NUM_LIMBS];
limb_t a_glo[NUM_LIMBS];
limb_t b_glo[NUM_LIMBS];
limb_t (*points_x_glo)[NUM_LIMBS];
limb_t (*points_y_glo)[NUM_LIMBS];
limb_t R_2_mod_m_glo[NUM_LIMBS];
limb_t m_prime_glo;
limb_t inv_R_glo[NUM_LIMBS];

gmp_int_t m_glo_gmp;
gmp_int_t a_glo_gmp;
gmp_int_t b_glo_gmp;
gmp_int_t *points_x_glo_gmp;
gmp_int_t *points_y_glo_gmp;
gmp_int_t R_2_mod_m_glo_gmp;
gmp_int_t m_prime_glo_gmp;
gmp_int_t inv_R_glo_gmp;

void initialize_constants(unsigned int num_points) {
    num_points_glo = num_points;
    /* create large pool of points by replicating src pool */
    points_x_glo_hex = calloc(num_points_glo, sizeof(*points_x_glo_hex));
    points_y_glo_hex = calloc(num_points_glo, sizeof(*points_y_glo_hex));
    for (unsigned int i = 0; i < num_points_glo; i++) {
        size_t strlen_x = strlen(points_x_glo_src_hex[i % NUM_POINTS_SRC]);
        size_t strlen_y = strlen(points_y_glo_src_hex[i % NUM_POINTS_SRC]);
        points_x_glo_hex[i] = calloc(strlen_x + 1, sizeof(*points_x_glo_hex[i]));
        points_y_glo_hex[i] = calloc(strlen_y + 1, sizeof(*points_y_glo_hex[i]));
        strcpy(points_x_glo_hex[i], points_x_glo_src_hex[i % NUM_POINTS_SRC]);
        strcpy(points_y_glo_hex[i], points_y_glo_src_hex[i % NUM_POINTS_SRC]);
    }
    points_x_glo_gmp = calloc(num_points_glo / NUM_ENTRIES_IN_LIMB, sizeof(*points_x_glo_gmp));
    points_y_glo_gmp = calloc(num_points_glo / NUM_ENTRIES_IN_LIMB, sizeof(*points_y_glo_gmp));
    points_x_glo = calloc(num_points_glo / NUM_ENTRIES_IN_LIMB, sizeof(*points_x_glo));
    points_y_glo = calloc(num_points_glo / NUM_ENTRIES_IN_LIMB, sizeof(*points_y_glo));

    /* initializing global gmp */
    gmp_int_init(m_glo_gmp);
    gmp_int_init(a_glo_gmp);
    gmp_int_init(b_glo_gmp);
    gmp_int_init(R_2_mod_m_glo_gmp);
    gmp_int_init(m_prime_glo_gmp);
    gmp_int_init(inv_R_glo_gmp);
    for (unsigned int i = 0; i < (num_points_glo / NUM_ENTRIES_IN_LIMB); i++) {
        gmp_int_init(points_x_glo_gmp[i]);
        gmp_int_init(points_y_glo_gmp[i]);
    }

    /* initializing local gmp */
    gmp_int_t base_gmp;
    gmp_int_t R_gmp;
    gmp_int_init(base_gmp);
    gmp_int_init(R_gmp);

    /* assign values to gmp representatives */
    gmp_int_ui_pow_ui(base_gmp, 2, BASE_EXPONENT);
    gmp_int_set_str(m_glo_gmp, m_glo_hex, 16);
    gmp_int_ui_pow_ui(R_gmp, 2, BASE_EXPONENT * NUM_LIMBS);
    gmp_int_mul(R_2_mod_m_glo_gmp, R_gmp, R_gmp);
    gmp_int_mod(R_2_mod_m_glo_gmp, R_2_mod_m_glo_gmp, m_glo_gmp);
    int inverse_exists[NUM_ENTRIES_IN_LIMB];
    gmp_int_invert(inverse_exists, m_prime_glo_gmp, m_glo_gmp, base_gmp);
    for (unsigned int i = 0; i < NUM_ENTRIES_IN_LIMB; i++) {
        assert(inverse_exists[i] != 0);
    }
    gmp_int_neg(m_prime_glo_gmp, m_prime_glo_gmp);
    gmp_int_mod(m_prime_glo_gmp, m_prime_glo_gmp, base_gmp);
    gmp_int_set_str(a_glo_gmp, a_glo_hex, 16);
    gmp_int_set_str(b_glo_gmp, b_glo_hex, 16);
    for (unsigned int i = 0; i < (num_points_glo / NUM_ENTRIES_IN_LIMB); i++) {
        gmp_int_set_strings(points_x_glo_gmp[i], points_x_glo_hex + (i * NUM_ENTRIES_IN_LIMB), 16);
        gmp_int_set_strings(points_y_glo_gmp[i], points_y_glo_hex + (i * NUM_ENTRIES_IN_LIMB), 16);
    }
    gmp_int_invert(inverse_exists, inv_R_glo_gmp, R_gmp, m_glo_gmp);
    for (unsigned int i = 0; i < NUM_ENTRIES_IN_LIMB; i++) {
        assert(inverse_exists[i] != 0);
    }

    /* assign values to limb_t representatives */
    convert_gmp_to_num(m_glo, m_glo_gmp, NUM_LIMBS);
    convert_gmp_to_num(R_2_mod_m_glo, R_2_mod_m_glo_gmp, NUM_LIMBS);
    convert_gmp_to_num(&m_prime_glo, m_prime_glo_gmp, 1);
    convert_gmp_to_num(a_glo, a_glo_gmp, NUM_LIMBS);
    convert_gmp_to_num(b_glo, b_glo_gmp, NUM_LIMBS);
    convert_gmp_to_num(inv_R_glo, inv_R_glo_gmp, NUM_LIMBS);
    for (unsigned int i = 0; i < (num_points_glo / NUM_ENTRIES_IN_LIMB); i++) {
        convert_gmp_to_num(points_x_glo[i], points_x_glo_gmp[i], NUM_LIMBS);
        convert_gmp_to_num(points_y_glo[i], points_y_glo_gmp[i], NUM_LIMBS);
    }

    /* free gmp memory */
    gmp_int_clear(base_gmp);
    gmp_int_clear(R_gmp);
}

void free_constants() {
    gmp_int_clear(m_glo_gmp);
    gmp_int_clear(a_glo_gmp);
    gmp_int_clear(b_glo_gmp);
    gmp_int_clear(R_2_mod_m_glo_gmp);
    gmp_int_clear(m_prime_glo_gmp);
    gmp_int_clear(inv_R_glo_gmp);

    for (unsigned int i = 0; i < (num_points_glo / NUM_ENTRIES_IN_LIMB); i++) {
        gmp_int_clear(points_x_glo_gmp[i]);
        gmp_int_clear(points_y_glo_gmp[i]);
    }

    for (unsigned int i = 0; i < num_points_glo; i++) {
        free(points_x_glo_hex[i]);
        free(points_y_glo_hex[i]);
    }

    free(points_x_glo_gmp);
    free(points_y_glo_gmp);
    free(points_x_glo);
    free(points_y_glo);
}
